const ListRows = () => {
  return (
    <>
      {Array.isArray(spot)
        ? spot.map((spot) => (
            <tr>
              <td>Centro comercial Moctezuma</td>
              <td>Francisco Chang</td>
              <td>Mexico</td>
            </tr>
          ))
        : null}
    </>
  );
};

export default ListRows;
